    'l': 'ĺ|ļ|ľ|ŀ|ł',
    'N': 'Ñ|Ń|Ņ|Ň',
    'n': 'ñ|ń|ņ|ň|ŉ',
    'O': 'Ò|Ó|Ô|Õ|Ō|Ŏ|Ǒ|Ő|Ơ|Ø|Ǿ',
